import { ArrowBackOutlined } from "@material-ui/icons"
import { useLocation } from "react-router-dom"
import "./watch.scss"

export default function Watch() {

  const location = useLocation();
  const movie1 = location.movie;
  return (
    <div className="watch">
        <div className="back">
            <ArrowBackOutlined/>
            Home
        </div> 
        <video className="video" autoPlay progress controls src={movie1.video}/> 
    </div>
  )
}
